import React from 'react';

class Login extends React.Component {
  render() {
    return (
      <div>
        <form>
          <input
            placeholder="Digite seu email"
            type="email"
            name="email"
            data-testid="email-input"
          />
          <input
            placeholder="Digite sua senha"
            type="password"
            name="password"
            data-testid="password-input"
          />
          <button
            disabled="true"
            type="button"
          >
            Entrar
          </button>
        </form>
      </div>
    );
  }
}

export default Login;
